// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Labimg {
    string[] public allImages;

    event ImageAdded(string img);

    function addImage(string memory _img) public {
        allImages.push(_img);
        emit ImageAdded(_img);
    }

    function getAllImages() public view returns (string[] memory) {
        return allImages;
    }
}
